import React from "react";
import {HashRouter,Route} from 'react-router-dom';
import About from './router/About';
import Home from "./router/Home";

function App() {
  return (
      <HashRouter>
        <Routes path="/" component={Home} />
        <Routes path="/about" component={About} />

      </HashRouter>

  );


  }

export default App;
